concatenate input x y = ((input !! (y - 1) !! (x - 1)) :
                         (input !! y !! x) :
                         (input !! (y + 1) !! (x + 1)) :
                         (input !! (y - 1) !! (x + 1)) :
                         (input !! y !! x) :
                         (input !! (y + 1) !! (x - 1)) :
                         "")

range input = [1..(length input)-2]

x_mas_count list = length [elem | elem <- list, elem == "MASMAS" || elem == "MASSAM" || elem == "SAMMAS" || elem == "SAMSAM"]

main = do
  --let input = example
  print (sum [x_mas_count list | list <- [[concatenate input x y | x <- (range input)] | y <- (range input)]])
